member.param:
When true the script is wrapped in a self executing function.
            Make sure to use a return statement in your javascript. e.g. (function () { return 42; })();
            When false don't include a return statement e.g. 42;

member.example:

This example shows how to modify headers, make sure you reassign the collection
once it's been modified.

var headers = request.Headers;
var userAgent = headers["User-Agent"];
headers["User-Agent"] = userAgent + " CefSharp";
request.Headers = headers;

Task<object> IAsyncMethodInterceptor.InterceptAsync(Func<object[], object> method, object[] parameters, string methodName)
{
  object result = method(parameters);
  Debug.WriteLine("Called " + methodName);
  return result;
 }


object IMethodInterceptor.Intercept(Func<object[], object> method, object[] parameters, string methodName)
{
  object result = method(parameters);
  Debug.WriteLine("Called " + methodName);
  return result;
 }

example.code:

public object IPropertyInterceptor.InterceptGet(Func<object> propertyGetter, string propertyName)
{
   object result = propertyGetter();
   Debug.WriteLine("InterceptGet " + propertyName);
   return result;
}


public object IPropertyInterceptor.InterceptSet(Action<object> propertySetter, object parameter, string propertName)
{
   Debug.WriteLine("InterceptSet " + propertName);
   propertySetter(parameter);
}


string script = "const newDiv = document.createElement('div'); newDiv.id = 'myElement'; document.body.append(newDiv);";
await Task.WhenAll(
    browser.WaitForSelectorAsync("#myElement");,
    chromiumWebBrowser.EvaluateScriptAsync(script));

